import React from 'react';
import { View } from 'react-native';
import SwipeCards from 'react-native-swipe-cards';
import Card from './components/organisms/Card';
import NoMoreCards from './components/molecules/NoMoreCards';

const cards = [
  {
    id: 1,
    name: 'Cristian Ronaldo',
    age: 25,
    pictures: ['https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSTZO17bRzvv3GcF1idzF6tVmTAfpI8LJU2ncN7Dg-YWQ&s'],
    location: 'Portugal',
  },
  {
    id: 2,
    name: 'Lionel Messy',
    age: 28,
    pictures: ['https://upload.wikimedia.org/wikipedia/commons/c/c1/Lionel_Messi_20180626.jpg'],
    location: 'Argentina',
  },

  {
    id: 3,
    name: 'David Beckham',
    age: 30,
    pictures: ['https://media.gq.com/photos/56eb1c3f1740841549748e55/master/pass/david-beckham-gq-0416-2.jpg'],
    location: 'England',
  },  
  // Add more cards as needed
];

export default function App() {
  const handleYup = (card) => {
    console.log('Liked:', card);
  };

  const handleNope = (card) => {
    console.log('Disliked:', card);
  };

  return (
    <View style={{ flex: 1 }}>
      <SwipeCards
        cards={cards}
        renderCard={(cardData) => <Card {...cardData} />}
        renderNoMoreCards={() => <NoMoreCards />}
        handleYup={handleYup}
        handleNope={handleNope}
      />
    </View>
  );
}
